import React from 'react';
import './App.css';
import valley from './photos/valley.jpg';

const App = props => {

  return (
    <div>
      <div id="sub-container">
        // eslint-disable-next-line jsx-a11y/alt-text
        <img className="background-image" src={valley} />
      </div>
    </div>
  )
}

export default App;
